// 热力图
import router from '@ohos.router'

@Entry
@Component
export default struct HotValuePage {
  @State widthSize: number = 10
  @State heightSize: number = 30
  // @State rotateAngle: number = 0
  // private flag: boolean = false
  @State value: number = 0 // 热力值
  @State like: boolean = false
  @State unlike: boolean = false

  onPageShow() {
    setTimeout(() => {
      this.value += 20
    }, 800)
    setTimeout(() => {
      this.value += 20
    }, 900)
    setTimeout(() => {
      this.value += 20
    }, 1000)
    setTimeout(() => {
      this.value += 20
    }, 1100)
  }

  build() {
    Scroll() {
      Column({ space: 18 }) {
        Image($r('app.media.Gl'))
          .width("100%")
          .height("40%")
        // .margin({ bottom: 24 })
        // 父容器设置direction为Direction.Ltr，子元素从左到右排列

        // 进度条
        Text('当前热力值').fontSize(12).fontColor(0xCCCCCC).width('90%')
        Progress({
          // value 应该是初始值的意思
          value: 0, total: 100, type: ProgressType.Linear })
          .animation({
            // delay: 800,
            duration: 2000,
            curve: Curve.EaseInOut
          })
            // 进度条进度 这里才能动态改变
          .value(this.value)
            // .onClick((e) => this.value = 0)
          .width('90%')
          .height(24)
          .color(Color.Orange)

        // 信息
        Row() {
          Column({ space: 5 }) {
            Row({ space: 8 }) {
              Text('厦门园林博览苑')
                .fontWeight(FontWeight.Medium)
                .fontSize(24)
              Text('4A')
                .backgroundColor(Color.Grey)
                .fontColor(Color.White)
                .padding(5)
                .borderRadius(6)
                .fontSize(14)
              Text('官方售票')
                .backgroundColor(Color.Orange)
                .borderRadius(6)
                .height(26)
                .padding(5)
                .fontSize(14)
            }
            // .justifyContent(FlexAlign.Start)
            .alignItems(VerticalAlign.Center)

            Row({ space: 5 }) {
              Text('4.9分')
                .fontColor(Color.Blue)
                .fontSize(18)
              Text('1.3万人想去')
                .backgroundColor(Color.Orange)
                .fontColor(Color.White)
                .padding(5)
                .borderRadius(6)
                .fontSize(14)
            }
            // .justifyContent(FlexAlign.Start)
            .alignItems(VerticalAlign.Center)
          }
          .alignItems(HorizontalAlign.Start)

          Row({ space: 5 }) {
            Image(this.like ? $r('app.media.like_y') : $r('app.media.like_g'))
              .width(36)
              .height(36)
              .onClick((e) => {
                this.like = !this.like
                // 再次点击like，切换为unlike
                if (!this.unlike && !this.like) {
                  this.unlike = true
                }
                // unlike点亮，再点击like，则切换为like
                if (this.unlike && this.like) {
                  this.unlike = false
                }
              })
            Image(this.unlike ? $r('app.media.unlike_y') : $r('app.media.unlike_g'))
              .width(36)
              .height(36)
              .onClick((e) => {
                this.unlike = !this.unlike
                // 再次点击unlike，切换到like
                if (!this.unlike && !this.like) {
                  this.like = true
                }
                // like点亮，再点击unlike，则切换为unlike
                if (this.unlike && this.like) {
                  this.like = false
                }
                if (this.unlike) {
                  AlertDialog.show(
                    {
                      title: '反馈',
                      message: '是否填写反馈信息',
                      autoCancel: true,
                      alignment: DialogAlignment.Bottom,
                      gridCount: 4,
                      offset: { dx: 0, dy: -20 },
                      primaryButton: {
                        value: '以后再说',
                        action: () => {
                          console.info('Callback when the first button is clicked')
                        }
                      },
                      secondaryButton: {
                        value: '填写反馈',
                        action: () => {
                          router.pushUrl({ url: 'pages/FeedBackPage' })
                          console.info('Callback when the second button is clicked')
                        }
                      },
                      cancel: () => {
                        console.info('Closed callbacks')
                      }
                    }
                  )
                }
              })
          }
        }
        .justifyContent(FlexAlign.SpaceBetween)
        .width('100%')
        .padding({ left: 16, right: 16, bottom: 12 })

        Row() {
          Text("目前人数较少景区")
            .width('100%')
            .fontColor(Color.White)
            .fontWeight(FontWeight.Medium)
            .fontSize(24)
        }
        .width('50%')
        .borderRadius(6)
        .backgroundColor(Color.Orange)
        .alignSelf(ItemAlign.Start)
        .padding(5)
        .margin({ left: 16 })

        Row({ space: 5 }) {
          Column() {
            Text('芙蓉隧道')
              .height(32)
