              .width('100%')
              .padding(4)
          }
        }
        .margin(12)

        Row() {
          Column() {
            Text('颂恩楼群')
              .height(32)
              .fontWeight(FontWeight.Medium)
              .fontSize(24)
            Image($r('app.media.Sh')).height(200).width('100%')
              .borderRadius(4)
            Text('厦门大学颂恩楼群是目前厦大的最气派的建筑群，其主楼是印尼校友死后由其妻子捐建，也没有冠名，由于是天主教友，所以取其颂主恩德之义。')
              .width('100%')
              .padding(4)
          }
        }
        .margin(12)

        Button("返回")
